import './App.css';
import React from 'react';
import Banner from './components/Banner';
import banner1 from "./assets/images/banner-1.png"
import banner2 from "./assets/images/banner-2.png"
import Header from './components/Header';
import FlatList from './components/FlatList';
import Dropdown from './components/Dropdown';
import Footer from './components/Footer';
import Tag from './components/Tag';
import flats from './datas/data';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom/cjs/react-router-dom.min';
import react from 'react';



function Accueil() {

  return (
    <><Banner title="true" image={banner1} /><FlatList /></>
  )
}

function About() {

  return (
    <><Banner title="true" image={banner2} />
    <Tag content={flats[0].tags[0]} />
    <Dropdown title="FiabilitÃ©" /></>
  )
}

class App extends React.Component {
  state = {
    post: {}
  }

  componentDidMount() {
    fetch('https://raw.githubusercontent.com/iliasse-e/iliasse-e-IliasseELABOUYI_11_31122021/main/data.json')
    .then((response) => {
      return response.json()
    })
    .then((result) => {
      this.setState({post: result})
    })
  }

  render() {
    console.log(this.state.post)
    return <div className="App">
        <Header />
        <FlatList name={this.state.post}/>
        <Router>
          <Switch>
            <Route path="/" exact component={Accueil} />
            <Route path="/about" exact component={About} />
            <Route path="/" exact component={About} />
          </Switch>

        </Router>
        <Footer />
    </div>
  };
}

export default App;
